package net.surfm.account.testdata;
public class PetAttr {

	private float atk = 0;
	private float def = 0;
	
	
	public PetAttr() {
		super();
	}

	public float getAtk() {
		return atk;
	}

	public void setAtk(float atk) {
		this.atk = atk;
	}

	public float getDef() {
		return def;
	}

	public void setDef(float def) {
		this.def = def;
	}

}